import React from 'react';
import { Typography, Container, Grid, Paper } from '@mui/material';

const Homepage = () => {
  return (
    <Container maxWidth="lg" sx={{ marginTop: 4 }}>
      <Grid container spacing={4}>
        {/* Section 1: Places */}
        <Grid item xs={12} md={6} lg={3}>
          <Paper elevation={3} sx={{ padding: 3, textAlign: 'center', borderRadius: 2 }}>
            <Typography variant="h5" gutterBottom>
              Places
            </Typography>
            {/* Content for Places will go here */}
          </Paper>
        </Grid>

        {/* Section 2: Lists */}
        <Grid item xs={12} md={6} lg={3}>
          <Paper elevation={3} sx={{ padding: 3, textAlign: 'center', borderRadius: 2 }}>
            <Typography variant="h5" gutterBottom>
              Lists
            </Typography>
            {/* Content for Lists will go here */}
          </Paper>
        </Grid>

        {/* Section 3: Reviews */}
        <Grid item xs={12} md={6} lg={3}>
          <Paper elevation={3} sx={{ padding: 3, textAlign: 'center', borderRadius: 2 }}>
            <Typography variant="h5" gutterBottom>
              Reviews
            </Typography>
            {/* Content for Reviews will go here */}
          </Paper>
        </Grid>

        {/* Section 4: Events */}
        <Grid item xs={12} md={6} lg={3}>
          <Paper elevation={3} sx={{ padding: 3, textAlign: 'center', borderRadius: 2 }}>
            <Typography variant="h5" gutterBottom>
              Events
            </Typography>
            {/* Content for Events will go here */}
          </Paper>
        </Grid>
      </Grid>
    </Container>
  );
};

export default Homepage;
